import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import ClubsDropdown from './dropdown/clubsDropdown';
import EventsDropdown from './dropdown/eventsDropdown';
import ProfileDropdown from './dropdown/profileDropdown';
import logo from '../images/logo.png';

const NavbarContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  background-color: #fff;
  z-index: 100;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0 20px;
`;

const NavbarLogo = styled.img`
  height: 60px;
  width: 100px;
  margin-right: 0;
`;

const NavbarLogoName = styled.p`
  display: flex;
  align-items: center;
  margin: auto;
  margin-left: 0;
  color: palevioletred;
  font-size: 24px;
  font-weight: bold;
  text-shadow: 0 0 10px #ff69b4;
  margin-right: 50px;
  margin-right: 350px;
`;

const NavbarLinks = styled.nav`
  ol {
    display: flex;
    list-style-type: none;
    margin: 0;
    padding: 0;
  }

  li {
    list-style-type: none;
  }

  a {
    color: #ff69b4;
    text-decoration: none;
    padding: 10px 15px;
    border-radius: 4px;
    transition: background-color 0.3s ease, color 0.3s ease;
    font-weight: bold;

    &:hover {
      background-color: #ff0000;
      color: white;
    }
  }
`;

const NavbarItem = styled.li`
  margin: 0 10px;
  margin-right: 20px;
  position: relative;
`;

const DropdownMenu = styled.div`
  a {
    display: block;
    padding: 5px 10px;
    color: #ff69b4;
    text-decoration: none;
    transition: background-color 0.3s ease, color 0.3s ease;

    &:hover {
      background-color: #ff0000;
      color: #fff;
    }
  }
`;

const Navbar = () => {
  return (
    <NavbarContainer>
      <div className="logo-container">
        <Link to="/home">
          <NavbarLogo src={logo} alt="Logo" />
        </Link>
      </div>
      <NavbarLogoName>VibeTribe</NavbarLogoName>
      <NavbarLinks>
        <ol>
          <NavbarItem className="navbar-item dropdown">
            <Link to="/clubs" className="nav-link">
              Clubs
            </Link>
            <ClubsDropdown />
          </NavbarItem>
          <NavbarItem className="navbar-item dropdown">
            <Link to="/events" className="nav-link">
              Events
            </Link>
            <EventsDropdown />
          </NavbarItem>
          <NavbarItem className="navbar-item">
            <Link to="/watch" className="nav-link">
              Watch
            </Link>
          </NavbarItem>
          <NavbarItem className="navbar-item">
            <Link to="/about" className="nav-link">
              About
            </Link>
          </NavbarItem>
          <NavbarItem className="navbar-item">
            <Link to="/calendar" className="nav-link">
              Calendar
            </Link>
          </NavbarItem>
          <NavbarItem className="navbar-item dropdown profile-button">
            <Link to="/profile" className="nav-link">
              Profile
            </Link>
            <ProfileDropdown />
          </NavbarItem>
        </ol>
      </NavbarLinks>
    </NavbarContainer>
  );
};

export default Navbar;
